import React, { useState, useEffect } from "react";
import { useNavigate, useLocation, Link } from "react-router-dom";
const Spinner = ({ path = "login" }) => {
  const navigate = useNavigate();
  const location = useLocation();

  useEffect(() => {
    navigate("/n");
  }, []);
  return (
    <>
      <div>
        <div>
          <span>Loading...</span>
        </div>
      </div>
    </>
  );
};

export default Spinner;
